import React from 'react';

import Navbar from 'react-bootstrap/Navbar';

const Navigation = function() {
    return (
        <Navbar>
            <Navbar.brand href="#">
                <img src="https://www.develop.realtystore.com/resources/site/images/logos/logo.png" alt="brand logo" />
            </Navbar.brand>
        </Navbar>
    )
}

export default Navigation;
